const Booking = () => {
    const [movie, setMovie] = useState()
    const id=useParams().id;
    console.log(id);
    useEffect(()=>{
        getMovieDetails(id).then((res)=>setMovie(res.movie)).catch(err=>console.log(err));
     },[id])
     console.log(movie);
  return (
    <div>
      {movie && <Fragment>
        <Typography padding={3} fontFamily="fantasy" variant='h4' textAlign={"center"}></Typography>
        </Fragment>}
    </div>
  )
}

